// Importe a propriedade Link do react-router-dom
import { Link } from 'react-router-dom';

// Seu componente React
function Header() {
  return (
    <div>
      {/* Use a propriedade Link dentro do seu componente */}
      <Link to="/">Home</Link>
      <Link to="/about">Contato</Link>
      <Link to="/contact">Empresa</Link>
      <Link to="/contact">Projetos</Link>
    </div>
  );
}

export default Header;
